pub enum DiffItem<'a, A> {

    /// This value has been added to the new set.
    Add(&'a A),

    /// This value has been changed between the two sets.
    Update {
        /// The old value.
        old: &'a A,
        /// The new value.
        new: &'a A,
    },

    /// This value has been removed from the new set.
    Remove(&'a A),
}

pub enum Entry<'a, K, V> where K: Ord + Clone, V: Clone {

    /// An entry which exists in the map.
    Occupied(OccupiedEntry),

    /// An entry which doesn't exist in the map.
    Vacant(VacantEntry),
}

pub enum Entry<'a, K, V, S> where K: Hash + Eq + Clone, V: Clone,
         S: BuildHasher {

    /// An entry which exists in the map.
    Occupied(OccupiedEntry),

    /// An entry which doesn't exist in the map.
    Vacant(VacantEntry),
}

pub enum Focus<'a, A> {

    #[doc(hidden)]
    Single(&'a [A]),

    #[doc(hidden)]
    Full(TreeFocus<A>),
}

pub enum FocusMut<'a, A> {

    #[doc(hidden)]
    Single(RRBPool<A>, &'a mut [A]),

    #[doc(hidden)]
    Full(RRBPool<A>, TreeFocusMut),
}
